import React from "react";


const Nav = ({children}) => {
  let items = React.Children.toArray(children);
  for(let i = items.length-1; i >= 1; i--){
    items.splice(i, 0, <span key={i} className='separator'>|</span>
    )
  }
  return(
    {items}
  )
}

export default Nav
